import React from 'react';

function GameList({ games }) {
  return (
    <ul>
      {games.map((game) => (
        <li key={game.id}>
          {/* Assuming each game object has an "id" property */}
          <GameDetails game={game} />
        </li>
      ))}
    </ul>
  );
}

export default GameList;
